class Solution:
    def threeSum(self, nums: list[int]) -> list[list[int]]:
        ans = []
        nums.sort()
        for ii in range(len(nums)-2):
            if ii > 0 and nums[ii] == nums[ii-1]:
                continue
            ret = self.twoSum(nums[ii+1:], -nums[ii])
            if ret == []:
                continue
            else:
                for jj in ret:
                    ans.append([nums[ii]] + jj)
        return ans

    def twoSum2(self, nums, target):
        d = {}
        ans = []
        for ii in nums:
            if ii in d:
                ans.append([ii, d[ii]])
            else:
                d[target - ii] = ii
        return ans

    def twoSum(self, nums, target):
        left, right = 0, len(nums) - 1
        ret = []
        while left < right:
            sum2 = nums[left] + nums[right]
            if sum2 == target:
                ret.append([nums[left], nums[right]])
                while left < right and nums[left] == nums[left + 1]:
                    left += 1
                while left < right and nums[right] == nums[right - 1]:
                    right -= 1
                left += 1
                right -= 1
            elif sum2 > target:
                right -= 1
            else:
                left += 1
        return ret

